import {Component} from "react"

const styles= {
    carro: {
        backgroundColor: '#359A2C',
        color: '#fff',
        border: 'none',
        padding: '15px',
        borderRadius: '10px',
        cursor: 'pointer'

    }
}
class Carro extends Component{
    render(){
        return(
            <div>
                <button style={style.carro}>
                    Carrito
                </button>
            </div>
        )
    }
}

export default Carro
